import QuoteList from '../components/quotes/QuoteList'

const DUMMY_QUOTES = [
  { id: 'q1', author: 'Max', text: 'Learning React is fun!' },
  { id: 'q2', author: 'Marc', text: 'Sometimes its not so much fun!' },
]

const AllQuotes = () => {
  return <QuoteList props={DUMMY_QUOTES} />
}

export default AllQuotes
